window.bookSummaryJSON = "<p><b>This program features multicast narration.</b></p> <p><b>“Exciting, thought-provoking, and ultimately shocking...I’m in for the ride to the very end!”—James Rollins on </b><b><i>A History of What Comes Next</i></b></p> <p><b>Against the backdrop of authentic historical events, Sylvain Neuvel concludes his acclaimed Take Them to the Stars series with a biting satire on the role of authority in all its guises, bringing us a truly breathtaking science fiction trilogy that spans the ages.</b></p> <p><i>When you don’t know The Rules it’s hard to stay safe.</i></p> <p>After a traumatic incident, Aster's blood work comes back with some unusual readings. Unsurprising, as she’s the last of an alien race called the Kibsu, though she doesn’t know it.</p> <p>She becomes the focus of a hunt, with her mortal enemies, the Trackers, on one side, and the American government on the other. But help has come from a most unexpected quarter.</p> <p>Whoever finds her first, it won’t be good news for Aster.</p> <p>Or for the world!</p> <p>Also Available by Sylvain Neuvel:</p> <p>Take Them to the Stars series:</p> <p>1. <i>A History of What Comes Next</i></p> <p>2. <i>Until the Last of Me</i></p> <p><i>The Test</i></p> <p><b>A Macmillan Audio Production from Tor.com.</b></p>"; 
